import re

def separate_paren_groups(paren_string: str) -> List[str]:
    def find_group(parentheses, start):
        if not parentheses:
            return []
        opening = parentheses.find('(')
        closing = parentheses.find(')')
        if opening == -1 or closing == -1 or opening > closing:
            return [parentheses[start:]]
        else:
            return [parentheses[start:opening]] + find_group(parentheses[opening+1:closing], opening+1) + find_group(parentheses[closing:], closing)

    return list(map(lambda x: ''.join(x), map(find_group, re.findall(r'\((.*?)\)', paren_string), [0])))
