def parse_nested_parens(paren_string: str) -> List[int]:
    def _parse_nested_parens(paren_str, depth=0):
        if not paren_str:
            return depth

        opening_parenthesis = paren_str.find('(')
        closing_parenthesis = paren_str.find(')')

        if opening_parenthesis != -1 and closing_parenthesis != -1:
            _parse_nested_parens(paren_str[:opening_parenthesis], depth + 1)
            return _parse_nested_parens(paren_str[closing_parenthesis+1:], depth - 1)
        elif opening_parenthesis != -1:
            return _parse_nested_parens(paren_str, depth + 1)
        else:
            return depth

    result = []
    for part in paren_string.split():
        result.append(_parse_nested_parens(part))

    return result
