from typing import List

def factorize(n: int) -> List[int]:
    factors = {}
    i = 2
    while i * i <= n:
        if n % i:
            i += 1
        else:
            count = n // i
            if i not in factors:
                factors[i] = count
                n /= i
            else:
                factors[i] += count
                factors[n] = 1
                n = 1
        if n > 1:
            factors[n] = 1
    return list(factors.values())
